INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60000, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0, 1, 190804, 1, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60000, 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 2, 0, 2, 0, 1, 0, 1, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60000, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 2, 0, 3, 0, 1, 0, 1, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60000, 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 2, 0, 4, 0, 2, 0, 1, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60000, 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 2, 0, 5, 0, 1, 0, 2, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60000, 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 2, 0, 6, 0, 1, 0, 2, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60000, 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2, 0, 7, 0, 2, 0, 2, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60000, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 2, 0, 8, 0, 1, 0, 3, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60000, 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 2, 0, 9, 0, 1, 0, 3, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60000, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 2, 0, 10, 0, 1, 0, 3, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60000, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 2, 0, 11, 0, 1, 0, 3, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60000, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 2, 0, 12, 0, 2, 0, 3, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60000, 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 2, 0, 13, 0, 1, 0, 4, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60000, 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 2, 0, 14, 0, 1, 0, 4, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60000, 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 2, 0, 15, 0, 1, 0, 4, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60000, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 2, 0, 16, 0, 1, 0, 4, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60000, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, 0, 17, 0, 2, 0, 4, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60000, 2, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 3, 0, 18, 190804, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60000, 3, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 7, 19, 190804, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 0, 1, 20, 101201, 0, 0, 0, "", "ハツネ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 0, 1, 21, 101201, 0, 0, 0, "", "ハツネ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 1, 1, 22, 103801, 0, 0, 0, "", "シオリ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "来年も、\n一緒にいられたら…\nうれしいな", 1, 1, 23, 103801, 0, 0, 0, "", "シオリ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "あなたと一緒にいるようになって、\nもう1年ですか…", 0, 2, 24, 103601, 0, 0, 0, "", "キョウカ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 0, 2, 25, 103601, 0, 0, 0, "", "キョウカ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "おにいちゃんとあってから、\n1年たったよ～！", 1, 2, 26, 102001, 0, 0, 0, "", "ミミ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 1, 2, 27, 102001, 0, 0, 0, "", "ミミ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 2, 2, 28, 100401, 0, 0, 0, "", "ミソギ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 2, 2, 29, 100401, 0, 0, 0, "", "ミソギ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 0, 3, 30, 101001, 0, 0, 0, "", "マホ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 0, 3, 31, 101001, 0, 0, 0, "", "マホ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 1, 3, 32, 104401, 0, 0, 0, "", "イリヤ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 1, 3, 33, 104401, 0, 0, 0, "", "イリヤ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 2, 3, 34, 101701, 0, 0, 0, "", "カオリ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "これからも、どうぞよろしく\nお願いするさ～！", 2, 3, 35, 101701, 0, 0, 0, "", "カオリ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "あんたと出会ってからもうそんなに\nたつのね～", 0, 4, 36, 102801, 0, 0, 0, "", "サレン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 0, 4, 37, 102801, 0, 0, 0, "", "サレン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 1, 4, 38, 102501, 0, 0, 0, "", "スズメ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 1, 4, 39, 102501, 0, 0, 0, "", "スズメ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "振り返れば、今までいろんなことが\nあったにゃあ…", 0, 5, 40, 104601, 0, 0, 0, "", "タマキ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 0, 5, 41, 104601, 0, 0, 0, "", "タマキ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 1, 5, 42, 104801, 0, 0, 0, "", "ミフユ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 1, 5, 43, 104801, 0, 0, 0, "", "ミフユ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "あなたさまと出会ってもう1年…", 0, 6, 44, 103201, 0, 0, 0, "", "アキノ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 0, 6, 45, 103201, 0, 0, 0, "", "アキノ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 1, 6, 46, 103401, 0, 0, 0, "", "ユカリ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 1, 6, 47, 103401, 0, 0, 0, "", "ユカリ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 0, 7, 48, 107101, 0, 0, 0, "", "クリスティーナ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "ともかくこれからも\n愉しませてくれよ☆", 0, 7, 49, 107101, 0, 0, 0, "", "クリスティーナ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 1, 7, 50, 104701, 0, 0, 0, "", "ジュン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "見えないから分からないって？\nそれもそうだな…", 1, 7, 51, 104701, 0, 0, 0, "", "ジュン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 0, 8, 52, 103701, 0, 0, 0, "", "トモ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "これからもよろしくね！", 0, 8, 53, 103701, 0, 0, 0, "", "トモ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 1, 8, 54, 100501, 0, 0, 0, "", "マツリ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 1, 8, 55, 100501, 0, 0, 0, "", "マツリ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "オマエと会って1年なの！\n全然成仏もできなかったし、", 0, 9, 56, 100701, 0, 0, 0, "", "ミヤコ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 0, 9, 57, 100701, 0, 0, 0, "", "ミヤコ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 1, 9, 58, 103101, 0, 0, 0, "", "シノブ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 1, 9, 59, 103101, 0, 0, 0, "", "シノブ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 0, 10, 60, 100901, 0, 0, 0, "", "アンナ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 0, 10, 61, 100901, 0, 0, 0, "", "アンナ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "君と出会ってもう1年だって！\n早いねー！", 1, 10, 62, 101301, 0, 0, 0, "", "ナナカ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 1, 10, 63, 101301, 0, 0, 0, "", "ナナカ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 0, 11, 64, 105101, 0, 0, 0, "", "ミツキ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "これからも、いろんなところを\n調べさせてね？", 0, 11, 65, 105101, 0, 0, 0, "", "ミツキ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "お前さんと出会ってもう1年か\n助太刀するつもりが", 1, 11, 66, 105601, 0, 0, 0, "", "ルカ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 1, 11, 67, 105601, 0, 0, 0, "", "ルカ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "早いものですわね、あなた様と\nお会いして、もう1年…", 2, 11, 68, 102701, 0, 0, 0, "", "エリコ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 2, 11, 69, 102701, 0, 0, 0, "", "エリコ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 0, 12, 70, 102301, 0, 0, 0, "", "アヤネ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 0, 12, 71, 102301, 0, 0, 0, "", "アヤネ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 1, 12, 72, 104201, 0, 0, 0, "", "チカ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "私のことを見守ってください\nできることなら、ずっと…", 1, 12, 73, 104201, 0, 0, 0, "", "チカ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 2, 12, 74, 102101, 0, 0, 0, "", "クルミ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 2, 12, 75, 102101, 0, 0, 0, "", "クルミ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 0, 13, 76, 104901, 0, 0, 0, "", "シズル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 0, 13, 77, 104901, 0, 0, 0, "", "シズル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 1, 13, 78, 101101, 0, 0, 0, "", "リノ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 1, 13, 79, 101101, 0, 0, 0, "", "リノ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 0, 14, 80, 100201, 0, 0, 0, "", "ユイ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 0, 14, 81, 100201, 0, 0, 0, "", "ユイ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 1, 14, 82, 100101, 0, 0, 0, "", "ヒヨリ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 1, 14, 83, 100101, 0, 0, 0, "", "ヒヨリ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 2, 14, 84, 100301, 0, 0, 0, "", "レイ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "キミに背中を預けられる日が、\n早くきますように", 2, 14, 85, 100301, 0, 0, 0, "", "レイ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 0, 15, 86, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "これからもずっと、覚えていて\nくださいね！", 0, 15, 87, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 1, 15, 88, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 1, 15, 89, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 1, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 2, 15, 90, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80001, 2, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 2, 15, 91, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 1, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 1, 0, 92, 112101, 1, 0, 0, "", "スズメ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 2, 0, 93, 0, 1, 0, 1, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 2, 0, 94, 0, 1, 0, 1, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 2, 0, 95, 0, 1, 0, 1, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 2, 0, 96, 0, 1, 0, 1, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 2, 0, 97, 0, 2, 0, 1, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 2, 0, 98, 0, 1, 0, 2, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 2, 0, 99, 0, 1, 0, 2, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 2, 0, 100, 0, 1, 0, 2, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 2, 0, 101, 0, 1, 0, 2, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 2, 0, 102, 0, 2, 0, 2, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 2, 0, 103, 0, 1, 0, 3, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 2, 0, 104, 0, 1, 0, 3, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 2, 0, 105, 0, 1, 0, 3, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 2, 0, 106, 0, 1, 0, 3, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 2, 0, 107, 0, 1, 0, 3, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 2, 0, 108, 0, 1, 0, 3, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 2, 0, 109, 0, 2, 0, 3, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 2, 0, 110, 0, 1, 0, 4, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 2, 0, 111, 0, 1, 0, 4, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 2, 0, 112, 0, 1, 0, 4, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 2, 0, 113, 0, 1, 0, 4, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 2, 0, 114, 0, 1, 0, 4, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 2, 0, 115, 0, 1, 0, 4, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, 0, 116, 0, 2, 0, 4, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 2, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 3, 0, 117, 112101, 0, 0, 0, "", "スズメ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60001, 3, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 3, 7, 118, 112101, 0, 0, 0, "", "スズメ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 1, "ヒューヒュー♪\nドンドンパフパフー♪", 0, 1, 119, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 1, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 1, 1, 120, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 2, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 1, 1, 121, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 1, "え？　ちょっと\nいきなりなにっ？", 2, 1, 122, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 2, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 2, 1, 123, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 2, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 0, 1, 124, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 3, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 0, 1, 125, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 3, "ですからその日に向けて\n今から気分を盛り上げているのです", 1, 1, 126, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 3, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 2, 1, 127, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 4, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 1, 1, 128, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 4, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 0, 1, 129, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 4, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 2, 1, 130, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 5, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 1, 1, 131, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 5, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 0, 2, 132, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 1, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 1, 2, 133, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 6, "げっ…カリンじゃない\nなんでもないわよ！", 0, 2, 134, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 2, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 1, 2, 135, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 7, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 0, 2, 136, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 3, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 1, 2, 137, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 8, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 0, 2, 138, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 9, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 0, 2, 139, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 4, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 1, 2, 140, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 10, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 0, 2, 141, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 5, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 1, 2, 142, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 11, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 0, 2, 143, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 6, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 0, 3, 144, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 5, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 1, 3, 145, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 7, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 0, 3, 146, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 8, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 0, 3, 147, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 6, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 1, 3, 148, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 7, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 1, 3, 149, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 9, "あとは、牧場に素敵な温泉が\n出来たとか…", 0, 3, 150, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 8, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 1, 3, 151, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 10, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 0, 3, 152, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 9, "えへへ、ありがとうございます\nコッコロちゃん！", 1, 3, 153, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 11, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 0, 3, 154, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 10, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 1, 3, 155, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 11, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 0, 4, 156, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 12, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 1, 4, 157, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 12, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 0, 4, 158, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 13, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 1, 4, 159, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 13, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 0, 4, 160, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 14, "…積極的？\nなんの話よ？", 1, 4, 161, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 14, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 0, 4, 162, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 15, "ムーサの町で\nきゃるきゃる～ん☆　って！", 0, 4, 163, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 15, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 1, 4, 164, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 16, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 0, 4, 165, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 16, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 1, 4, 166, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 17, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 1, 4, 167, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 18, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 0, 5, 168, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 12, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 1, 5, 169, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 19, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 0, 5, 170, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 13, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 1, 5, 171, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 20, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 0, 5, 172, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 14, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 1, 5, 173, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 21, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 0, 5, 174, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 15, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 1, 5, 175, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 22, "かくし芸？", 0, 5, 176, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 16, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 1, 5, 177, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 23, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 0, 5, 178, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 17, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 0, 6, 179, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 24, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 2, 6, 180, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 17, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 1, 6, 181, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 18, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 0, 6, 182, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 25, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 2, 6, 183, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 18, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 1, 6, 184, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 26, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 2, 6, 185, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 27, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 2, 6, 186, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 28, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 2, 6, 187, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 19, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 0, 6, 188, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 19, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 1, 6, 189, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 29, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 2, 6, 190, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 30, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 0, 7, 191, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 31, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 0, 7, 192, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 32, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 0, 7, 193, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 33, "あー\nあー\n…声、これで大丈夫かしら？", 0, 7, 194, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 34, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 0, 7, 195, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 35, "オイッスー☆", 0, 7, 196, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 36, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 0, 7, 197, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 37, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 0, 7, 198, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 38, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 0, 7, 199, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 20, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 0, 8, 200, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 21, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 0, 8, 201, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 22, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 0, 8, 202, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 23, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 0, 8, 203, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 24, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 0, 8, 204, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 25, "オイッスー☆", 0, 8, 205, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 26, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 0, 8, 206, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 27, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 0, 8, 207, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 28, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 0, 8, 208, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 20, "オイッスー☆", 0, 9, 209, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 21, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 0, 9, 210, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 22, "あと６日で2.5周年ですか…", 0, 9, 211, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 23, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 0, 9, 212, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 24, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 0, 9, 213, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 25, "オイッスー☆", 0, 9, 214, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 26, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 0, 9, 215, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 27, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 0, 9, 216, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 28, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 0, 9, 217, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 29, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 0, 9, 218, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 30, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 0, 9, 219, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 31, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 0, 10, 220, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 29, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 1, 10, 221, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 32, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 0, 10, 222, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 39, "…………", 2, 10, 223, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 30, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 1, 10, 224, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 40, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 2, 10, 225, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 33, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 0, 10, 226, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 41, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 2, 10, 227, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 34, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 0, 10, 228, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 35, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 0, 10, 229, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 42, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 2, 10, 230, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 31, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 1, 10, 231, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 43, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 2, 10, 232, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 36, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 0, 10, 233, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 6, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 0, 11, 234, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 7, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 0, 11, 235, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 8, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 0, 11, 236, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 9, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 0, 11, 237, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 10, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 0, 11, 238, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 11, "次にコッコロさんですが\nこちらは発声練習をしています", 0, 11, 239, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 12, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 0, 11, 240, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 13, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 0, 11, 241, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 14, "あれ？\nもしかして緊張で気を失って…？", 0, 11, 242, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 15, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 0, 11, 243, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 16, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 0, 11, 244, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 17, "それでは\nまた明日お会いしましょう♪", 0, 11, 245, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 44, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 0, 12, 246, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 37, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 2, 12, 247, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 32, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 1, 12, 248, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 45, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 0, 12, 249, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 38, "ひどいですよぉキャルちゃ～ん！", 2, 12, 250, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 33, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 1, 12, 251, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 39, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 2, 12, 252, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 46, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 0, 12, 253, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 34, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 1, 12, 254, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 40, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 2, 12, 255, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 41, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 0, 13, 256, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 47, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 2, 13, 257, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 42, "忘れてきちゃいました☆", 0, 13, 258, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 48, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 2, 13, 259, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 35, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 1, 13, 260, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 49, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 2, 13, 261, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 43, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 0, 13, 262, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 50, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 2, 13, 263, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 36, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 1, 13, 264, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 51, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 2, 13, 265, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 37, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 1, 13, 266, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 52, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 2, 13, 267, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 44, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 0, 13, 268, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 38, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 1, 13, 269, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 45, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 0, 13, 270, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 53, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 2, 13, 271, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 46, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 0, 13, 272, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 18, "こんにちは\n【ギルド管理協会】のカリンです", 0, 14, 273, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 19, "昨日の生放送は\nいかがだったでしょうか？", 0, 14, 274, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 20, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 0, 14, 275, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 21, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 0, 14, 276, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 22, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 0, 14, 277, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 23, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 0, 14, 278, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 24, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 0, 14, 279, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 25, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 0, 14, 280, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 26, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 0, 14, 281, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 27, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 0, 14, 282, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 47, "準備はいいですかっ？\n…いっきますよー！", 0, 15, 283, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 54, "祝！", 2, 15, 284, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 39, "2.5周年！", 1, 15, 285, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 48, "おめでとうございま～す☆", 0, 15, 286, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 55, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 2, 15, 287, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 40, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 1, 15, 288, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 49, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 0, 15, 289, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 56, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 2, 15, 290, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 41, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 1, 15, 291, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 57, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 2, 15, 292, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 50, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 0, 15, 293, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 58, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 2, 15, 294, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 51, "記念日だから\n平気平気♪\nやばいですね☆", 0, 15, 295, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 59, "意味分かんないわよ！", 2, 15, 296, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 42, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 1, 15, 297, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 43, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 1, 15, 298, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 52, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 0, 15, 299, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 60, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 2, 15, 300, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 44, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 1, 15, 301, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 53, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 0, 15, 302, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80003, 54, "2.5周年\nありがとうございます！", 0, 15, 303, 105801, 0, 1, 0, "105901,45,106001,61", "ペコリーヌ・コッコロ・キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0, 304, 190804, 1, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 2, 0, 305, 0, 1, 0, 1, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 2, 0, 306, 0, 1, 0, 1, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 2, 0, 307, 0, 1, 0, 1, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 2, 0, 308, 0, 1, 0, 1, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 2, 0, 309, 0, 2, 0, 1, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 2, 0, 310, 0, 1, 0, 2, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 2, 0, 311, 0, 1, 0, 2, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 2, 0, 312, 0, 1, 0, 2, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 2, 0, 313, 0, 1, 0, 2, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 2, 0, 314, 0, 2, 0, 2, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 2, 0, 315, 0, 1, 0, 3, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 2, 0, 316, 0, 1, 0, 3, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 2, 0, 317, 0, 1, 0, 3, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 2, 0, 318, 0, 1, 0, 3, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 2, 0, 319, 0, 1, 0, 3, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 2, 0, 320, 0, 1, 0, 3, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 2, 0, 321, 0, 2, 0, 3, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 2, 0, 322, 0, 1, 0, 4, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 2, 0, 323, 0, 1, 0, 4, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 2, 0, 324, 0, 1, 0, 4, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 2, 0, 325, 0, 1, 0, 4, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 2, 0, 326, 0, 1, 0, 4, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 2, 0, 327, 0, 1, 0, 4, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 2, 0, 328, 0, 2, 0, 4, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 2, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 3, 0, 329, 190804, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60002, 3, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 7, 330, 190804, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 1, "ささ、シェフィさまはこちらへ…", 4, 1, 331, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 1, "コッコロさん、どこへ行くの…？\n…え？", 0, 1, 332, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 1, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 3, 1, 333, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 2, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 4, 1, 334, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 2, "ええと…\n二人とも何をしているの？", 0, 1, 335, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 1, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 1, 1, 336, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 3, "あの日…？", 0, 1, 337, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 2, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 3, 1, 338, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 3, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 3, 1, 339, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 1, "やばいですね☆", 2, 1, 340, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 2, "って、なにしれっと\n参加してんのよカリン！", 1, 1, 341, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 2, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 2, 1, 342, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 3, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 2, 1, 343, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 4, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 3, 1, 344, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 4, "えっ！？　ええとええと…！\nあ、あと14日…！", 0, 1, 345, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 5, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 3, 2, 346, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 3, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 1, 2, 347, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 4, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 1, 2, 348, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 6, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 3, 2, 349, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 5, "さすがでございます\nペコリーヌさま", 1, 2, 350, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 3, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 0, 2, 351, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 5, "しゃなり、しゃなり…\nふふ、案外できるものね", 2, 2, 352, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 7, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 3, 2, 353, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 6, "さ、次はキャルさまの\n番でございますよ", 1, 2, 354, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 4, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 0, 2, 355, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 6, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 2, 2, 356, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 5, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 0, 2, 357, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 6, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 0, 2, 358, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 7, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 1, 2, 359, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 7, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 0, 2, 360, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 8, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 1, 3, 361, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 8, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 3, 3, 362, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 9, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 1, 3, 363, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 7, "聖学祭…って、なにかしら？", 2, 3, 364, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 10, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 1, 3, 365, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 8, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 0, 3, 366, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 9, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 0, 3, 367, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 9, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 3, 3, 368, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 10, "いや、そのまんますぎでしょ…", 0, 3, 369, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 8, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 2, 3, 370, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 10, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 3, 3, 371, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 9, "えっ？　ええ…\nぎゅーっ…？", 2, 3, 372, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 11, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 0, 4, 373, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 10, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 2, 4, 374, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 12, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 0, 4, 375, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 11, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 1, 4, 376, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 13, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 0, 4, 377, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 11, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 3, 4, 378, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 14, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 0, 4, 379, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 15, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 0, 4, 380, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 11, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 2, 4, 381, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 12, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 3, 4, 382, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 12, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 1, 4, 383, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 16, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 0, 4, 384, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 12, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 2, 4, 385, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 13, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 3, 5, 386, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 14, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 3, 5, 387, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 15, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 3, 5, 388, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 17, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 0, 5, 389, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 18, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 0, 5, 390, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 13, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 2, 5, 391, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 13, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 1, 5, 392, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 16, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 3, 5, 393, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 19, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 0, 5, 394, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 17, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 3, 5, 395, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 18, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 3, 5, 396, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 19, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 3, 5, 397, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 4, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 2, 6, 398, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 5, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 2, 6, 399, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 20, "…えっ！？", 1, 6, 400, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 20, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 3, 6, 401, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 14, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 0, 6, 402, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 14, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 4, 6, 403, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 15, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 0, 6, 404, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 21, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 1, 6, 405, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 21, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 3, 6, 406, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 22, "ぶっ殺すぞ！？", 1, 6, 407, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 6, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 2, 6, 408, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 15, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 1, 7, 409, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 23, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 0, 7, 410, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 16, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 2, 7, 411, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 22, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 3, 7, 412, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 24, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 0, 7, 413, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 17, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 2, 7, 414, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 16, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 1, 7, 415, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 18, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 2, 7, 416, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 17, "もちろんでございます\n仲良くお勉強いたしましょう", 1, 7, 417, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 25, "しれっと教育ママが\n生まれてる…？", 0, 7, 418, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 23, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 3, 7, 419, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 26, "え～～～～！？", 0, 7, 420, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 27, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 0, 8, 421, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 19, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 2, 8, 422, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 18, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 1, 8, 423, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 24, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 3, 8, 424, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 20, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 2, 8, 425, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 28, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 0, 8, 426, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 19, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 1, 8, 427, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 21, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 2, 8, 428, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 29, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 0, 8, 429, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 30, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 0, 8, 430, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 25, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 3, 8, 431, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 31, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 0, 8, 432, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 22, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 0, 9, 433, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 23, "…えっ？\n生放送の意気込み！？\n突然なに！？", 0, 9, 434, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 24, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 0, 9, 435, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 25, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 0, 9, 436, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 26, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 0, 9, 437, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 27, "それから、それから…！\nぅ、ぅぅっ…！", 0, 9, 438, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 28, "―びえぇぇ～んっ！！！", 0, 9, 439, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 20, "どうされましたか、シェフィさま", 1, 9, 440, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 29, "ううっ…ひっく…\nママッ…！", 0, 9, 441, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 21, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 1, 9, 442, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 22, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 1, 9, 443, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 30, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 0, 9, 444, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 23, "主さま\n3.5周年まであと５日\nでございます", 0, 10, 445, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 24, "ですがその前に\n生放送がありますね", 0, 10, 446, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 25, "…生放送に向けた\n意気込みでございますか？", 0, 10, 447, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 26, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 0, 10, 448, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 27, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 0, 10, 449, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 28, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 0, 10, 450, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 29, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 0, 10, 451, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 30, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 0, 10, 452, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 31, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 0, 10, 453, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 26, "3.5周年まであと４日！\nやばいですね☆", 0, 11, 454, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 32, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 1, 11, 455, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 27, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 0, 11, 456, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 28, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 0, 11, 457, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 29, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 0, 11, 458, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 33, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 1, 11, 459, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 30, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 0, 11, 460, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 31, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 0, 11, 461, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 32, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 0, 11, 462, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 34, "だからあたしはやるなんて一言も…", 1, 11, 463, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 33, "オイッスー☆", 0, 11, 464, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 35, "聞きなさいっての！！", 1, 11, 465, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 31, "3.5周年まであと３日…\nそして生放送は、明日…", 2, 12, 466, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 32, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 2, 12, 467, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 33, "おいっす！\n…こうじゃなかったわね\nええと確か…", 2, 12, 468, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 34, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 2, 12, 469, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 35, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 2, 12, 470, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 34, "やってますねシェフィちゃん！", 3, 12, 471, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 36, "なによ、考えることは\nみんな同じってこと？", 0, 12, 472, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 32, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 1, 12, 473, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 36, "みんな…もちろんよ！", 2, 12, 474, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 35, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 3, 12, 475, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 7, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 2, 13, 476, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 8, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 2, 13, 477, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 36, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 3, 13, 478, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 9, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 2, 13, 479, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 33, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 4, 13, 480, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 10, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 2, 13, 481, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 37, "大丈夫…大丈夫…\nあたしは大丈夫…", 1, 13, 482, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 11, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 2, 13, 483, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 37, "あうー？", 0, 13, 484, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 37, "あ…", 4, 13, 485, 105801, 0, 1, 0, "105901,34,106001,38,190801,12", "みんな");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 39, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 1, 13, 486, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 35, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 4, 13, 487, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 38, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 3, 13, 488, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 13, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 2, 13, 489, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 38, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 2, 14, 490, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 39, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 3, 14, 491, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 40, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 0, 14, 492, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 36, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 1, 14, 493, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 39, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 2, 14, 494, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 40, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 3, 14, 495, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 37, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 1, 14, 496, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 41, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 0, 14, 497, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 40, "へ、へぇ…", 2, 14, 498, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 41, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 3, 14, 499, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 41, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 2, 14, 500, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 42, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 2, 14, 501, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 42, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 3, 15, 502, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 42, "祝！", 1, 15, 503, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 38, "3.5周年！", 4, 15, 504, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 43, "おめでとうございます！", 0, 15, 505, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 14, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 2, 15, 506, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 15, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 2, 15, 507, 190801, 0, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 43, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 3, 15, 508, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 44, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 3, 15, 509, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 43, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 1, 15, 510, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 44, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 1, 15, 511, 106001, 0, 0, 0, "", "キャル");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 44, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 0, 15, 512, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 45, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 0, 15, 513, 106401, 0, 0, 0, "", "シェフィ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 39, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 4, 15, 514, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 40, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 4, 15, 515, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 41, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 4, 15, 516, 105901, 0, 0, 0, "", "コッコロ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 45, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 3, 15, 517, 105801, 0, 0, 0, "", "ペコリーヌ");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (80005, 46, "これからも\nよろしくおねがいします！", 4, 15, 518, 105801, 0, 1, 0, "105901,42,106001,45,106401,46,190801,16", "みんな");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60003, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0, 519, 190804, 1, 0, 0, "", "カリン");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60003, 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 2, 0, 520, 0, 1, 0, 1, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60003, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 2, 0, 521, 0, 1, 0, 1, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60003, 0, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 2, 0, 522, 0, 1, 0, 1, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60003, 0, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 2, 0, 523, 0, 1, 0, 1, "", "");
INSERT INTO `v1_796752edb4ecce751d347e1afc74b32f4a3441e1d6ace27cb29f6de36a7ece1f` VALUES (60003, 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 2, 0, 524, 0, 2, 0, 1, "", "");
